        return (
            <ul className="dark">

                <li><NavLink to='/signin'>SignIn</NavLink></li>
                <li><NavLink to='/signup'>SignUp</NavLink></li>
                <li><NavLink to='/show'>All Posts</NavLink></li>
                <li><NavLink to='/new'>New Post</NavLink></li>


            </ul>
        )





    }
}

export default SignedOutLinks
